import Navbar from './components/Navbar/Navbar';
import LandingPage from './Screens/LandingPage/LandingPage';

import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {
  return (

   <BrowserRouter>
   <div>
     <Navbar />
  <Routes>
  <Route path="/" element={<LandingPage />} />

  </Routes>
  </div>
  </BrowserRouter>


  );
}

export default App;
